import React, { Component } from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
// import Modal from "react-bootstrap/Modal"
import "./style.css";

class TrainerFormModal extends Component {

    render () {
        return (
            <Form className="trainerForm">
                <Form.Group controlId="formBasicEmail">
                    <Form.Label>Name</Form.Label>
                    <Form.Control type="text" placeholder="Enter name" />
                </Form.Group>

                <Form.Group controlId="formBasicPassword">
                    <Form.Label>Pokemon</Form.Label>
                    <Form.Control type="password" placeholder="Pokemon name" />
                </Form.Group>

                <Form.Group controlId="formBasicPassword">
                    <Form.Label>Type</Form.Label>
                    <Form.Control type="password" placeholder="Enter type" />
                </Form.Group>

                <Form.Group controlId="formBasicPassword">
                    <Form.Label>Move</Form.Label>
                    <Form.Control type="password" placeholder="Enter moves" />
                </Form.Group>

                <Button variant="primary" type="submit">
                Submit
                </Button>
            </Form>
        )
    }
}


export default TrainerFormModal;
